export const getAlbum = (album) => {
	return lib.tracks.filter( trk => {
		return trk.Album === album;
	});
}

export const getGenre = (genre) => {
	return lib.tracks.filter( trk => {
		return trk.Genre === genre;
	});
}

export const libFilter = (q) => {
	return lib.tracks.filter( trk => {
		if ( stringMatch(trk.Artist, q) || stringMatch(trk.Album, q) || stringMatch(trk.Name, q) ) {
			return true;
		}
	})
}

const stringMatch = (term, query) => {
	return (term.toLowerCase().indexOf(query.toLowerCase()) != -1);
}